import React from "react";

function UserRegister() {
  return (
    <div className="container text-light">
      <div className="row">
        <div className="col-md-12" align="right">
          <h2>
            {" "}
            <i className="fa fa-user"></i> Create Your Account
          </h2>
        </div>
      </div>
    </div>
  );
}

export default UserRegister;
